import React from 'react';
import CoverImga from "../../Assests/Images/background/bg-1.png";
import CoverImgb from "../../Assests/Images/background/2.png";
import CoverImgc from "../../Assests/Images/background/1.png";

import { Carousel } from "react-bootstrap";



function MiddleBanner() {
    return (
        <Carousel>
        <Carousel.Item interval={2000}>
          <img
            className="d-block w-100"
            src="https://zom-in.com/images/banner/homepage-banner/bp-myfitbox-more-info.jpeg"
            alt="First slide"
          />
        </Carousel.Item>
        <Carousel.Item interval={2000}>
          <img
            className="d-block w-100"
            src="https://zom-in.com/images/banner/homepage-banner/bp-dawn-adaptive-more-info.jpeg"
            alt="Second slide"
          />
        </Carousel.Item>
        <Carousel.Item interval={2000}>
          <img
            className="d-block w-100"
            src="https://zom-in.com/images/banner/homepage-banner/bp-myfitbox-more-info.jpeg"
            alt="Third slide"
          />
        </Carousel.Item>
      </Carousel>
    )
}

// https://zom-in.com/images/banner/homepage-banner/bp-myfitbox-more-info.jpeg
// https://zom-in.com/images/banner/homepage-banner/bp-dawn-adaptive-more-info.jpeg
export default MiddleBanner;
